import React from "react";
import HomeIcon from "./assets/icons/home-svgrepo-com.svg";
import ProfileIcon from "./assets/icons/profile-round-1346-svgrepo-com.svg";
import FolderIcon from "./assets/icons/folder-svgrepo-com.svg";
import ContactIcon from "./assets/icons/contacts-svgrepo-com.svg";
import { BrowserRouter, Routes, Route } from "react-router";
import ProfilePage from "./Profile";

function App() {
  const hellos = [
    { lang: "English", text: "Hello" },
    { lang: "Spanish", text: "Hola" },
    { lang: "French", text: "Bonjour" },
    { lang: "German", text: "Hallo" },
    { lang: "Italian", text: "Ciao" },
    { lang: "Japanese", text: "こんにちは" },
    { lang: "Korean", text: "안녕하세요" },
    { lang: "Russian", text: "Привет" },
  ];

  const [index, setIndex] = React.useState(0);
  const [displayed, setDisplayed] = React.useState("");
  const [phase, setPhase] = React.useState("typing"); // typing, deleting, waiting

  React.useEffect(() => {
    let timeout;
    const current = hellos[index].text;

    if (phase === "typing") {
      if (displayed.length < current.length) {
        timeout = setTimeout(() => {
          setDisplayed(current.slice(0, displayed.length + 1));
        }, 120);
      } else {
        timeout = setTimeout(() => setPhase("waiting"), 800);
      }
    } else if (phase === "waiting") {
      timeout = setTimeout(() => setPhase("deleting"), 700);
    } else if (phase === "deleting") {
      if (displayed.length > 0) {
        timeout = setTimeout(() => {
          setDisplayed(current.slice(0, displayed.length - 1));
        }, 60);
      } else {
        timeout = setTimeout(() => {
          setIndex((prev) => (prev + 1) % hellos.length);
          setPhase("typing");
        }, 300);
      }
    }
    return () => clearTimeout(timeout);
  }, [displayed, phase, index, hellos]);

  return (
    <div className="min-h-screen bg-black flex">
      <nav className="w-48 text-white flex flex-col justify-center items-center py-8 px-4">
        <a
          href="#home"
          className="mb-6 text-lg flex items-center group icon-padding"
        >
          <img src={HomeIcon} alt="Home" className="w-10 h-10 mr-2" />
          <span className="bg-blue-400 text-white rounded px-2 py-1 ml-0 max-w-0 opacity-0 overflow-hidden transition-all duration-300 group-hover:max-w-xs group-hover:opacity-100 group-hover:ml-2 whitespace-nowrap">
            Home
          </span>
        </a>
        <a
          href="/profile"
          className="mb-6 text-lg flex items-center group icon-padding"
        >
          <img src={ProfileIcon} alt="Profile" className="w-8 h-8 mr-2" />
          <span className="bg-blue-400 text-white rounded px-2 py-1 ml-0 max-w-0 opacity-0 overflow-hidden transition-all duration-300 group-hover:max-w-xs group-hover:opacity-100 group-hover:ml-2 whitespace-nowrap">
            Profile
          </span>
        </a>
        <a
          href="#projects"
          className="mb-6 text-lg flex items-center group icon-padding"
        >
          <img src={FolderIcon} alt="Projects" className="w-10 h-10 mr-2" />
          <span className="bg-blue-400 text-white rounded px-2 py-1 ml-0 max-w-0 opacity-0 overflow-hidden transition-all duration-300 group-hover:max-w-xs group-hover:opacity-100 group-hover:ml-2 whitespace-nowrap">
            Projects
          </span>
        </a>
        <a
          href="#contact"
          className="mb-6 text-lg flex items-center group icon-padding"
        >
          <img src={ContactIcon} alt="Contact" className="w-10 h-10 mr-2" />
          <span className="bg-blue-400 text-white rounded px-2 py-1 ml-0 max-w-0 opacity-0 overflow-hidden transition-all duration-300 group-hover:max-w-xs group-hover:opacity-100 group-hover:ml-2 whitespace-nowrap">
            Contact
          </span>
        </a>
      </nav>
      {/* Main Content */}
      <div className="flex-1 flex flex-col items-center justify-center">
        <div className="text-white text-4xl font-bold min-h-[2.5rem]">
          {displayed}
          <span className="animate-pulse text-blue-400">|</span>
        </div>
        <div className="text-blue-400 mt-2 text-lg">{hellos[index].lang}</div>
      </div>
    </div>
  );
}

export default App;
